import React, { useState, useEffect } from "react";
import {
  Text,
  View,
  TextInput,
  TouchableOpacity,
  Alert,
  Picker,
  Image,
} from "react-native";
import axios from "axios";
import * as ImagePicker from 'expo-image-picker';


export const RegisterDoctor = () => {
  const [name, setName] = useState("");
  const [firstname, setFirstname] = useState("");
  const [contact, setContact] = useState("");
  const [speciality, setSpeciality] = useState("");
  const [experience, setExperience] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [selectedRole, setSelectedRole] = useState("");
  const [roles, setRoles] = useState([]);

const [photo, setPhoto] = useState(null);

const selectPhoto = async () => {
    try {
      const result = await ImagePicker.launchImageLibraryAsync({
        mediaTypes: ImagePicker.MediaTypeOptions.All,
        allowsEditing: true,
        aspect: [4, 3],
        quality: 1,
      });
  
      if (!result.cancelled) {
        if (result.assets && result.assets.length > 0) {
          const selectedAsset = result.assets[0];
          if (selectedAsset.uri) {
            setPhoto(selectedAsset.uri);
            console.log("Selected photo:", selectedAsset.uri);
          } else {
            console.error("Selected file URI is undefined.");
          }
        } else {
          console.error("No assets found in the result.");
        }
      }
    } catch (error) {
      console.error('ImagePicker Error:', error);
    }
  };
  

  useEffect(() => {
    // Fetch roles from your backend when the component mounts
    axios
      .get("http://127.0.0.1:3000/role/getRole")
      .then((response) => {
        setRoles(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  const roletenaizy = roles.filter((role) => role !== "patient");

  const handleSubmit = () => {
    if (!name || !firstname || !contact || !speciality || !experience || !email || !password || !selectedRole) {
      Alert.alert("Error", "Please fill in all fields");
      return;
    }
  
    // Function to convert the selected photo to base64
  
    // Function to convert a blob to base64
    const blobToBase64 = (blob) => {
      return new Promise((resolve, reject) => {
        const reader = new FileReader();
        reader.onerror = reject;
        reader.onload = () => {
          resolve(reader.result);
        };
        reader.readAsDataURL(blob);
      });
    };
  
    // Convert the selected photo to base64
    convertImageToBase64(photo)
      .then((photoBase64) => {
        // Prepare the data to be sent to the server for registration
        const formData = new FormData();
        formData.append("name", name);
        formData.append("firstname", firstname);
        formData.append("contact", contact);
        formData.append("speciality", speciality);
        formData.append("experience", experience);
        formData.append("email", email);
        formData.append("password", password);
        formData.append("Role", selectedRole);
        formData.append("photoBase64", photoBase64 || ''); // Add the base64 image data or an empty string
  
        console.log(formData);
  
        axios.post("http://127.0.0.1:3000/doctor/inscriptionDoctor", formData, {
          headers: {
            "Content-Type": "multipart/form-data",
          },
        })
        .then((response) => {
          console.log(response.data);
          Alert.alert("Success", "Registration successful");
        })
        .catch((error) => {
          console.error(error);
          Alert.alert("Error", "Registration failed");
        });
      })
      .catch((error) => {
        console.error(error);
        Alert.alert("Error", "Failed to convert image to base64");
      });
  };
  return (
    <View style={{ flex: 1, backgroundColor: "white", paddingHorizontal: 20, paddingTop: 20 }}>
      <Text style={{ fontSize: 30 }}>Sign Up</Text>
      <View style={{ marginTop: 20 }}>
        <Text>Photo:</Text>
        {photo && (
          <Image
            source={photo}
            style={{ width: 100, height: 100 }}
          />
        )}
        <TouchableOpacity
          style={{ backgroundColor: "blue", borderRadius: 20, padding: 15, alignItems: "center" }}
          onPress={selectPhoto}
        >
          <Text style={{ color: "white", fontWeight: "bold", fontSize: 20 }}>Select Photo</Text>
        </TouchableOpacity>

        <Text>Nom :</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="raharimanana"
          onChangeText={(text) => setName(text)}
        />
        <Text>Prénoms :</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="fabiola"
          onChangeText={(text) => setFirstname(text)}
        />
        <Text>Contact:</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="contact"
          onChangeText={(text) => setContact(text)}
        />
        <Text>Speciality:</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="specialité"
          onChangeText={(text) => setSpeciality(text)}
        />
        <Text>Experience:</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="experience"
          onChangeText={(text) => setExperience(text)}
        />
        <Text>Email Address:</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          placeholder="email"
          onChangeText={(text) => setEmail(text)}
        />
        <Text>Password:</Text>
        <TextInput
          style={{ padding: 10, backgroundColor: "lightgray", borderRadius: 10, marginBottom: 10 }}
          secureTextEntry
          placeholder="mot de passe"
          onChangeText={(text) => setPassword(text)}
        />

        <Text>Role:</Text>
        <Picker
          style={{
            padding: 10,
            backgroundColor: "lightgray",
            borderRadius: 10,
            marginBottom: 10,
          }}
          selectedValue={selectedRole}
          onValueChange={(itemValue, itemIndex) => setSelectedRole(itemValue)}
        >
          <Picker.Item label="Select a Role" value="" />
          {roletenaizy.map((role) => (
            <Picker.Item
              key={role._id}
              label={role.RoleTitle}
              value={role._id}
            />
          ))}
        </Picker>

        <TouchableOpacity
          style={{ backgroundColor: "blue", borderRadius: 20, padding: 15, alignItems: "center" }}
          onPress={handleSubmit}
        >
          <Text style={{ color: "white", fontWeight: "bold", fontSize: 20 }}>Sign Up</Text>
        </TouchableOpacity>
      </View>
    </View>
  );
};
